import React from 'react';
import { lightGray, darkGray, primaryOrange, white } from './colors';

function Form() {
    return (
        <div style={{
            padding: '20px',
            margin: '20px auto',
            maxWidth: '600px',
            backgroundColor: white,
            borderRadius: '8px',
            boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
        }}>
            <form>
                <label htmlFor="dossier" style={{ display: 'block', marginBottom: '5px', color: darkGray }}>Dossier:</label>
                <input type="text" id="dossier" placeholder="Entrez le numéro du dossier" />

                <label htmlFor="compte" style={{ display: 'block', marginBottom: '5px', marginTop: '10px', color: darkGray }}>Compte No:</label>
                <input type="text" id="compte" placeholder="Entrez le numéro du compte" />

                <label htmlFor="raison" style={{ display: 'block', marginBottom: '5px', marginTop: '10px', color: darkGray }}>Raison Sociale:</label>
                <input type="text" id="raison" placeholder="Entrez la raison sociale" />
            </form>
        </div>
    );
}

export default Form;
